openapi: 3.0.2
info:
  title: DataNet
  version: 1.0.0
paths:
  "/image/upload":
    post:
      tags:
      - image
      summary: Upload
      operationId: upload_image_upload_post
      requestBody:
        content:
          application/x-www-form-urlencoded:
            schema:
              "$ref": "#/components/schemas/Body_upload_image_upload_post"
        required: true
      responses:
        '200':
          description: Successful Response
          content:
            application/json:
              schema:
                "$ref": "#/components/schemas/UploadSummary"
        '422':
          description: Validation Error
          content:
            application/json:
              schema:
                "$ref": "#/components/schemas/HTTPValidationError"
  "/users/search":
    post:
      tags:
      - users
      summary: List Users
      description: takes any json as request body
      operationId: list_users_users_search_post
      responses:
        '200':
          description: Successful Response
          content:
            application/json:
              schema:
                "$ref": "#/components/schemas/UsersResponse"
  "/users":
    post:
      tags:
      - users
      summary: Upload
      operationId: upload_users_post
      requestBody:
        content:
          application/json:
            schema:
              "$ref": "#/components/schemas/FaceList"
        required: true
      responses:
        '201':
          description: Successful Response
          content:
            application/json:
              schema: {}
        '422':
          description: Validation Error
          content:
            application/json:
              schema:
                "$ref": "#/components/schemas/HTTPValidationError"
  "/users/{user_id}":
    put:
      tags:
      - users
      summary: Edit User
      description: takes any json as request body
      operationId: edit_user_users__user_id__put
      parameters:
      - required: true
        schema:
          title: User Id
          type: string
        name: user_id
        in: path
      responses:
        '200':
          description: Successful Response
          content:
            application/json:
              schema: {}
        '422':
          description: Validation Error
          content:
            application/json:
              schema:
                "$ref": "#/components/schemas/HTTPValidationError"
  "/users/find":
    post:
      tags:
      - users
      summary: Edit User
      operationId: edit_user_users_find_post
      requestBody:
        content:
          application/json:
            schema:
              "$ref": "#/components/schemas/FindInput"
        required: true
      responses:
        '200':
          description: Successful Response
          content:
            application/json:
              schema: {}
        '422':
          description: Validation Error
          content:
            application/json:
              schema:
                "$ref": "#/components/schemas/HTTPValidationError"
  "/users/batch-edit":
    post:
      tags:
      - users
      summary: Upload
      operationId: upload_users_batch_edit_post
      requestBody:
        content:
          application/x-www-form-urlencoded:
            schema:
              "$ref": "#/components/schemas/Body_upload_users_batch_edit_post"
        required: true
      responses:
        '200':
          description: Successful Response
          content:
            application/json:
              schema:
                "$ref": "#/components/schemas/BatchEditResponse"
        '422':
          description: Validation Error
          content:
            application/json:
              schema:
                "$ref": "#/components/schemas/HTTPValidationError"
